import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom'
import NovelApp from './NovelApp'

function App() {
  return (
    <Router>
      <div className="App">
        <Route exact path="/" component={NovelApp} />
      </div>
    </Router>
  );
}

export default App;
